import './App.css';

function App() {

  const planets= [
    {name: "Mars", isGasPlanet: false},
    {name: "Earth", isGasPlanet: false},
    {name: "Jupiter", isGasPlanet: true}
  ];

  return (
    <div className="App">
      {planets.map((planet, key) =>
       planet.isGasPlanet &&  planet.name
      )}
      </div>
  );
}

export default App;
